import React, { useContext } from 'react';

import { SharedStateContext } from './_SharedStateComponent';

export default function AppletActiveClientPersonas() {

	const { currentClient } = useContext(SharedStateContext);

	const personas = JSON.parse(currentClient.personas);

	if (!personas || personas.length === 0) {
		return <div>No personas available.</div>;
	};

	return (
		<>
			{/* Window for Target Personas */}
			<div id="tabcontent-personas" className="view-window row tabcontent">

				{/* Header Section */}
				<div className="view-header col-12">
					<h2>Target Personas</h2>
				</div>

				{personas.map(persona => (
					<>
					{/* Persona Header */}
					<div className="view-header col-12">
						<h3>{persona.name}</h3>
					</div>						
					
					{/* Persona Content */}
					<div className="row">

						{/* Section 01 */}
						<div className="col-md-12 col-12">
							<div className="row">

								{/* Overview */}
								<h4>Overview:</h4>

								<div className="col-md-6 col-12">
									<h5>Industry Summary:</h5>
									<p>{persona.industrySummary}</p>
								</div>

								<div className="col-md-6 col-12">
									<h5>Services:</h5>
									<p>{persona.services}</p>
								</div>

							</div>
						</div>

						{/* Section 02 */}
						<div className="col-md-12 col-12">
							<div className="row">

								{/* Competitors */}
								<h4>Competitors:</h4>
									
								{persona.competitors.map((competitor, index) => (

									<div key={index} className="col-md-6 col-12">
										<h5>{competitor.name}</h5>
										<p>{competitor.description} </p>
										<ul>
											<li><strong>Pros -</strong> {competitor.pros}</li>
											<li><strong>Cons -</strong> {competitor.cons}</li>
										</ul>
										
									</div>

								))}
									
							</div>
						</div>

						{/* Section 03 */}
						<div className="col-md-12 col-12">
							<div className="row">

								{/* Content Areas */}
								<h4>Content Areas:</h4>

								{persona.contentAreas.map((area, index) => (
									
									<div key={index} className="col-md-4 col-12">
										<h5>{area.name}</h5>
										<ul>
											{area.examples.map((example, exIndex) => (
												<li key={exIndex}><p><em>"{example}"</em></p></li>
											))}
										</ul>
									</div>
								))}
									
							</div>
						</div>


					</div>
					</>

				))}

			</div>

		</>
	);
};
